class Stack:
    def __init__(self):
        self.items = []

    def is_empty(self):
        return not bool(self.items)

    def push(self, item):
        self.items.append(item)

    def pop(self):
        return self.items.pop()

    def peek(self):
        return self.items[-1]

    def size(self):
        return len(self.items)


def is_matched(expression):
    s = Stack()
    openings = "([{"
    closings = ")]}"

    for p in expression:
        if p in openings:
            s.push(p)
        elif p in closings:
            if s.is_empty():
                return False
            elif openings[closings.index(p)] != s.pop():
                return False
    return s.is_empty()


print(is_matched("()[]{}"))  # True
print(is_matched("(]"))  # False
print(is_matched("([)]"))  # False
print(is_matched("{[]}"))  # True
